import React, { Component } from 'react';


class URL extends Component {

    
    constructor (url) {
         this.url = 'https://teamrocket-reportes-backend.herokuapp.com/ApiController/';
    }
  // Getter
  get   url  ()   {  
      return this.url();
    }
   




}
